import React from 'react';
import { Table } from 'reactstrap';
import moment from 'moment';

export default class UsersInCore extends React.Component {
  render() {
    // const users = this.prop.users;

    return (
      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>Initials</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Logged In</th>
          </tr>
        </thead>

        {/* <tbody>
          {users.map((user, index) => {
            return(
              <tr>
                <td>{index}</td>
                <td>{user.intials}</td>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{moment(user.entrytimestamp).format('YYYYMMMd')}</td>
              </tr>
            );
          })}
        </tbody> */}
      </Table>
    );
  }
}
